                '#B00000' => [230, 340],
                '#662D91' => [340, 10000]
            ],
            'so2' => [
                '#00AEEC' => [0, 100],
                '#00BD01' => [100, 200],
                '#EFE800' => [200, 350],
                '#E79C00' => [350, 500],
                '#B00000' => [500, 750],
                '#662D91' => [750, 10000]
            ],
            'nh3' => [
                '#00AEEC' => [0, 2],
                '#00BD01' => [2, 5],
                '#EFE800' => [5, 30],
                '#E79C00' => [30, 100],
                '#B00000' => [100, 300],
                '#662D91' => [300, 10000]
            ],
            'pm10' => [
                '#00AEEC' => [0, 20],
                '#00BD01' => [20, 40],
                '#EFE800' => [40, 60],
                '#E79C00' => [60, 100],
                '#B00000' => [100, 150],
                '#662D91' => [150, 10000]
            ],
            'pm25' => [
                '#00AEEC' => [0, 10],
                '#00BD01' => [10, 20],
                '#EFE800' => [20, 25],
                '#E79C00' => [25, 50],
                '#B00000' => [50, 75],
                '#662D91' => [75, 10000]
            ]
        ];

    foreach ($composants[$name] as $color => $range) {
        if ($range[0] <= $value && $range[1] > $value) {
            return $color;
        }
    }
}

